help_text: "NAME\n    gcloud kms keys - create and manage keys\n\nSYNOPSIS\n    gcloud\
  \ kms keys GROUP | COMMAND [--keyring=KEYRING] [--location=LOCATION]\n        [GCLOUD_WIDE_FLAG\
  \ ...]\n\nDESCRIPTION\n    A key represents a logical key that can be used for cryptographic\n\
  \    operations.\n\nFLAGS\n     --keyring=KEYRING\n        The containing keyring.\n\
  \n     --location=LOCATION\n        The location of the requested resource.\n\n\
  GCLOUD WIDE FLAGS\n    These flags are available to all commands: --account, --configuration,\n\
  \    --flatten, --format, --help, --log-http, --project, --quiet, --trace-token,\n\
  \    --user-output-enabled, --verbosity. Run $ gcloud help for details.\n\nGROUPS\n\
  \    GROUP is one of the following:\n\n     versions\n        Create and manage\
  \ versions.\n\nCOMMANDS\n    COMMAND is one of the following:\n\n     add-iam-policy-binding\n\
  \        Add IAM policy binding to a key.\n\n     create\n        Create a new key.\n\
  \n     describe\n        Get metadata for a given key.\n\n     get-iam-policy\n\
  \        Get the IAM policy for a key.\n\n     list\n        List the keys within\
